function wppfm_auto_feed_fix_changed(){wppfm_auto_feed_fix_mode(jQuery("#wppfm_auto_feed_fix_mode").is(":checked"),function(a){console.log("Auto feed fix setting changed to "+a)})}function wppfm_background_processing_mode_changed(){wppfm_background_processing_mode(jQuery("#wppfm_background_processing_mode").is(":checked"),function(a){console.log("Background processing setting changed to "+a)})}function wppfm_third_party_attributes_changed(){wppfm_change_third_party_attribute_keywords(jQuery("#wppfm_third_party_attr_keys").val(),function(a){console.log("Third party attributes changed to "+a)})}function wppfm_notice_mailaddress_changed(){wppfm_change_notice_mailaddress(jQuery("#wppfm_notice_mailaddress").val(),function(a){console.log("Notice recipient setting changed to "+a)})}function wppfm_clear_feed_process(){wppfm_show_feed_spinner();wppfm_clear_feed_process_data(function(a){console.log("Clear feed process activated");wppfm_hide_feed_spinner()})}function wppfm_reinitiate(){wppfm_show_feed_spinner();wppfm_reinitiate_plugin(function(a){console.log("Re-initialization initiated "+a);wppfm_hide_feed_spinner()})}function wppfm_backup(){var a=jQuery("#wppfm_backup-file-name");if(a.val()!==""){jQuery("#wppfm_backup-wrapper").hide();wppfm_initiateBackup(a.val(),function(b){wppfm_resetBackupsList();if(b!=="1"){wppfm_show_error_message("New backup file made "+b)}})}else{alert(wppfm_setting_form_vars.first_enter_file_name)}}function wppfm_deleteBackupFile(b){var a=confirm(wppfm_setting_form_vars.confirm_file_deletion.replace("%backup_file_name%",b));if(a===true){wppfm_deleteBackup(b,function(c){wppfm_show_success_message(wppfm_setting_form_vars.file_deleted.replace("%backup_file_name%",b));wppfm_resetBackupsList();console.log("Backup file deleted "+c)})}}function wppfm_restoreBackupFile(b){var a=confirm(wppfm_setting_form_vars.confirm_file_restoring.replace("%backup_file_name%",b));if(a===true){wppfm_restoreBackup(b,function(c){if(c==="1"){wppfm_show_success_message(wppfm_setting_form_vars.file_restored.replace("%backup_file_name%",b));wppfm_resetOptionSettings();console.log("Backup file restored "+c)}else{wppfm_show_error_message(c)}})}}function wppfm_duplicateBackupFile(a){wppfm_duplicateBackup(a,function(b){if(b==="1"){wppfm_show_success_message(wppfm_setting_form_vars.file_duplicated.replace("%backup_file_name%",a));console.log("Backup file duplicated"+b)}else{wppfm_show_error_message(b)}wppfm_resetBackupsList()})};